import { IconButton, Typography } from "@mui/material";
import React, { useEffect } from "react";
import {Link, useNavigate} from 'react-router-dom';
import MenuIcon from '@mui/icons-material/Menu';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import Drawee from "./Drawee";
export default function Dashboard() {
  const settings = ['Profile', 'Account', 'Dashboard', 'Logout'];
  const [anchorElUser, setAnchorElUser] = React.useState(null);

  const handleOpenUserMenu = (event) => {
    setAnchorElUser(event.currentTarget);
  }
  const handleCloseUserMenu = (event) => {
    setAnchorElUser(null);
  }
  const usenavigate = useNavigate();
  useEffect(()=>{
    let username = sessionStorage.getItem('username');
    if(username === '' || username === null){
      usenavigate('/');
    }
  },[]);

  return(
    <div>
      <div className="header">
        <Drawee />
        <IconButton onClick={handleOpenUserMenu}>
          <AccountCircleIcon style={{color:'#fff', fontSize:40}} />
        </IconButton>
        <Menu
              sx={{ mt: '45px' }}
              id="menu-appbar"
              anchorEl={anchorElUser}
              anchorOrigin={{
                vertical: 'top',
                horizontal: 'right',
              }}
              keepMounted
              transformOrigin={{
                vertical: 'top',
                horizontal: 'right',
              }}
              open={Boolean(anchorElUser)}
              onClose={handleCloseUserMenu}
            >
              {settings.map((setting) => (
                <MenuItem key={setting} onClick={handleCloseUserMenu}>    
                  <Link to={`/${setting}`} style={{textDecoration:'none'}} >
                    <Typography textAlign="center" color={'primary'}>{setting}</Typography>
                  </Link>
                </MenuItem>

              ))}
            </Menu>

        {/* <Link to={'/dashboard'}>Home</Link>
        <Link to={'/'}>Logout</Link> */}
      </div>
    <Typography textAlign={'center'} my={20} variant="h3" color={'primary'}>Welcome to Dashboard</Typography>
  </div>
  );
}
